Class.Documentation_plain:
Main class that runs the application and initializes the default objects,
such as initial {@link Auth Authentication Menu}, {@link Products}, {@link Promotions}, current time (by a class {@link Date}) and {@link Scanner} to read inputs.

@author Eduardo Nunes

Class that handles the authentication of the application,
here the user is asked to enter his/her email and redirected to the logged In menu.

@author Eduardo Nunes

Class that represents a default Customer, this class extends into different types of Customers.
We need more than one type of Customer since the transport value is calculated differently.

@author Eduardo Nunes

Class that represents a default Promotion, this class extends into different types of Promotions.
We need more than one type of Promotion since the price calculation of an {@link Order} is different for each type of Promotion.

@author Eduardo Nunes
